import React, { useState } from "react";
const App=()=>{
    // let num=0;
    let state=useState();
    let [count,setCount]=useState('0:0:00 AM');
    let date=new Date();

    const IncNum=()=>{
       setCount(date.toLocaleDateString);
    //    console.log(count++);
    }
    return (
        <>
            <div className="CLICK">
            <h1>{count}</h1>
            <button onClick={IncNum}>Click Me</button>
            </div>
        </>
    )
}
export default App;
